    $widget_title_typography = of_get_option('widgettitle_typography');

    $top_header_type = $top_header_typography['face'];
    $menu_type = $primarymenu_typography['face'];
    $footer_menu_type = $footermenu_typography['face'];
    $bigslide_title_type = $bigslide_title_typography['face'];
    $smallslide_title_type = $smallslide_title_typography['face'];
