    $h4_type = $h4_typography['face'];
    $h5_type = $h5_typography['face'];
    $h6_type = $h6_typography['face'];
    $footer_title_type = $footer_title_typography['face'];
    $widget_title_type = $widget_title_typography['face'];

    $top_header_style = $top_header_typography['style'];
    $menu_style = $primarymenu_typography['style'];
    $footer_menu_style = $footermenu_typography['style'];
    $bigslide_title_style = $bigslide_title_typography['style'];
    $smallslide_title_style = $smallslide_title_typography['style'];
    $body_style = $body_typography['style'];
    $h1_style = $h1_typography['style'];
    $h2_style = $h2_typography['style'];
    $h3_style = $h3_typography['style'];
    $h4_style = $h4_typography['style'];
    $h5_style = $h5_typography['style'];
    $h6_style = $h6_typography['style'];
    $footer_title_style = $footer_title_typography['style'];
    $widget_title_style = $widget_title_typography['style'];

    
    $top_header_type_str = str_replace(' ', '+', $top_header_type);
    $menu_type_str = str_replace(' ', '+', $menu_type);
    $footer_menu_type_str = str_replace(' ', '+', $footer_menu_type);
    $bigslide_title_type_str = str_replace( '' , '+', $bigslide_title_type);
    $smallslide_title_type_str = str_replace( '' , '+', $smallslide_title_type);
    $body_type_str = str_replace(' ', '+', $body_type);
    $h1_type_str = str_replace(' ', '+', $h1_type);
    $h2_type_str = str_replace(' ', '+', $h2_type);
    $h3_type_str = str_replace(' ', '+', $h3_type);
    $h4_type_str = str_replace(' ', '+', $h4_type);
    $h5_type_str = str_replace(' ', '+', $h5_type);
    $h6_type_str = str_replace(' ', '+', $h6_type);
    $footer_title_type_str = str_replace(' ', '+', $footer_title_type);
    $widget_title_type_str = str_replace(' ', '+', $widget_title_type);
    
    $default_fonts = array('Arial', 'Verdana', 'Trebuchet', 'Georgia', 'Tahoma', 'Palatino', 'Helvetica');
    $all_fonts = array();

    if ($top_header_type != "" && !in_array($top_header_type, $default_fonts)) {
    	$all_fonts[] = $top_header_type_str.":".$top_header_style;
    }
    
    if ($menu_type != "" && !in_array($menu_type, $default_fonts)) {
    	$all_fonts[] = $menu_type_str.":".$menu_style;
    }

    if ($footer_menu_type != "" && !in_array($footer_menu_type, $default_fonts)) {
    	$all_fonts[] = $footer_menu_type_str.":".$footer_menu_style;
    }

    if ($bigslide_title_type != "" && !in_array($bigslide_title_type, $default_fonts)) {
    	$all_fonts[] = $bigslide_title_type_str.":".$bigslide_title_style;
    }

    if ($smallslide_title_type != "" && !in_array($smallslide_title_type, $default_fonts)) {
