    }

    if ($body_type != "" && !in_array($body_type, $default_fonts)) {
    	$all_fonts[] = $body_type_str.":".$body_style;
    }

    if ($h1_type != "" && !in_array($h1_type, $default_fonts)) {
    	$all_fonts[] = $h1_type_str.":".$h1_style;
    }

    if ($h2_type != "" && !in_array($h2_type, $default_fonts)) {
    	$all_fonts[] = $h2_type_str.":".$h2_style;
    }

    if ($h3_type != "" && !in_array($h3_type, $default_fonts)) {
    	$all_fonts[] = $h3_type_str.":".$h3_style;
    }

    if ($h4_type != "" && !in_array($h4_type, $default_fonts)) {
    	$all_fonts[] = $h4_type_str.":".$h4_style;
    }

    if ($h5_type != "" && !in_array($h5_type, $default_fonts)) {
       	$all_fonts[] = $h5_type_str.":".$h5_style;
    }

    if ($h6_type != "" && !in_array($h6_type, $default_fonts)) {
        $all_fonts[] = $h6_type_str.":".$h6_style;
    }

    if ($footer_title_type != "" && !in_array($footer_title_type, $default_fonts)) {
        $all_fonts[] = $footer_title_type_str.":".$footer_title_style;
    }

    if ($widget_title_type != "" && !in_array($widget_title_type, $default_fonts)) {
        $all_fonts[] = $widget_title_type_str.":".$widget_title_style;
    }
    
    $all_font = implode("|", $all_fonts);
  
    $query_args = array(
        'family' => $all_font,
    	'subset' => 'latin,cyrillic-ext,greek-ext,greek,vietnamese,latin-ext,cyrillic,khmer,devanagari,arabic,hebrew,telugu'
    ); 
    
    echo "\n<link href='" . add_query_arg($query_args, "//fonts.googleapis.com/css") . "' rel='stylesheet' type='text/css'>\n";
}

add_action('wp_head', 'accesspress_pro_googlefont_cb');

